    value: 'On January 29, 2014, the Republican National Committee (RNC) authorized
      the Republican Party of Florida (RPOF) to serve as the agent of the RNC for
      the limited purpose of making coordinated expenditures pursuant to 2 U.S.C.
      441a(d)(3). The RNC authorized the RPOF to spend, on behalf of the RNC, a maximum
      of $36,600 in connection with the March 11, 2014 Special Election for Floridas
      13th Congressional District. On February 26, 2014, the RPOF transferred $6,000
      of the $36,600 previously delegated authority to make coordinated expenditures
      pursuant to 2 U.S.C. 441a(d)(3) to the National Republican Congressional Committee
      (NRCC). As of February 1, 2014, the RPOF had the authority to make coordinated
      expenditures up to $83,200. The RPOF made coordinated expenditures of $40,439.36
      in the month of February and transferred $6,000 of its authority to make coordinated
      expenditures to the NRCC. As of March 1, 2014, the RPOF had the authority to
      make coordinated expenditures up to $36,760.64. The RPOF made coordinated expenditures
      of $34,030.54 in the month of March. The transfer reflected on Sch H3 on 3/11/14
      reflects the nonfederal expenses that were paid for and reported on Sch H4 for
      2/1/14 - 2/28/14. No expenditure, other than a direct contribution, exempt activity,
      in-kind contribution or coordinated expenditure so identified, was made on behalf
      of a specifically identified federal candidate. No expenditure not identified
      and reported as such was for a public communication that referred to a clearly
      identified candidate for Federal office and that promoted, supported, attacked
      or opposed any such candidate for Federal office. All expenditures to individuals
      for rent that do not have a subsequent memo of itemization, represent rent income
      to those individuals and are not required to be itemized. The salaries and related
      fringe benefits of employees of the Committee who spent more than 25% of their
      compensated time during the month of March engaged in Federal Election Activity
      are reported on Schedule B Line 30(b). Payments for salaries and related fringe
      benefits disclosed on Schedule H4 are for employees who spent less than 25%
      of their time engaged in activities in connection to any federal election. The
      Committee uses the Escrow option for receipt of corporate in-kind donations
      as provided for by the Commission in Advisory Opinion 1992-33. The method ensures
      that prohibited sources are not used to fund the federal share of allocable
      activity expenses. In-kind details and the escrow account activity are summarized
      as follows:   COMBINED ESCROW BALANCE OF $20,221.74 as of 2/28/14.   3/1/14
      Demetree Enterprises, LLP in-kind of $1,500 as reflected on Sch H4 and transfer
      on Sch H3 using $225 of escrow balance.   3/12/14 Walt Disney Parks & Resorts
      in-kind of $1,095.43 as reflected on Sch H4 and transfer on Sch H3 using $131.45
      of escrow balance.   3/25/14 Ballard Partners in-kind of $2,150 as reflected
